//Delegateyourvotetothevoter$(to).functiondelegate(addressto){Votersender=voters[msg.sender];//assignsreferenceif(sender.voted)return;while(voters[to].delegate!=address(0)&&voters[to].delegate!=msg.sender)to=voters[to].delegate;if(to==msg.sender)return;sender.voted=true;sender.delegate=to;Voterdelegate=voters[to];if(delegate.voted)proposals[delegate.vote].voteCount+=sender.weight;elsedelegate.weight+=sender.weight;}///Giveasinglevotetoproposal$(proposal).functionvote(uint8proposal){Votersender=voters[msg.sender];if(sender.voted||proposal>=proposals.length)return;sender.voted=true;sender.vote=proposal;proposals[proposal].voteCount+=sender.weight;}functionwinningProposal()constantreturns(uint8winningProposal){uint256winningVoteCount=0;for(uint8proposal=0;proposal<proposals.length;proposal++)if(proposals[proposal].voteCount>winningVoteCount){winningVoteCount=proposals[proposal].voteCount;winningProposal=proposal;}}}","source":{"sources":{"browser/Untitled.sol":"pragma solidity ^0.4.0;\ncontract Ballot {\n\n    struct Voter {\n        uint weight;\n        bool voted;\n        uint8 vote;\n        address delegate;\n    }\n    struct Proposal {\n        uint voteCount;\n    }\n\n    address chairperson;\n    mapping(address => Voter) voters;\n    Proposal[] proposals;\n\n    /// Create a new ballot with $(_numProposals) different proposals.\n    function Ballot(uint8 _numProposals) {\n        chairperson = msg.sender;\n        voters[chairperson].weight = 1;\n        proposals.length = _numProposals;\n    }\n\n    /// Give $(voter) the right to vote on this ballot.\n    /// May only be called by $(chairperson).\n    function giveRightToVote(address voter) {\n        if (msg.sender != chairperson || voters[voter].voted) return;\n        voters[voter].weight = 1;\n    }\n\n    /// Delegate your vote to the voter $(to).\n    function delegate(address to) {\n        Voter sender = voters[msg.sender]; // assigns reference\n        if (sender.voted) return;\n        while (vo